import React from 'react'

const About = () => {
  return (
    <div>
      Hey folks,<br />
      This is a web based application created using ReactJs, NodeJs, MongoDB and Bootstrap. It has Login
      and SignUp functionalities.
      Here you can create notes, update notes and also delete notes. 
      A particular user's notes will be visible only after login using correct credentials.
      
    </div>
  )
}

export default About
